a:260:{i:0;a:1:{s:2:"id";s:19:"2390923299662532503";}i:1;a:1:{s:10:"short_code";s:11:"CEuRBLJlw-X";}i:2;a:1:{s:12:"created_time";i:1599240289;}i:3;a:1:{s:7:"caption";s:1501:"Labor Day weekend 🤔 Want to take your pasta #dinner or #lunch one notch up? Yeah!!!! Try this roasted beet salad with balsamic vinegar dressing & you’ll feel 💕 & it’s haven for your taste buds! This one is for sure my top fav simple salad!! 

Some Italian restaurants serves roasted beet salad that I absolutely love. This year since I haven’t gone to eat out much, it’s time to make my own! I couldn’t find arugula so making with spinach but it’s equally yummy 😋 
1 serving
Roasted Beet salad ingredients:
- [ ] 1 cup Spinach or baby arugula 
- [ ] 1 Beet roasted (I choose half off each golden & red) 
- [ ] 2 tbsp Goat cheese or feta 
- [ ] 2 tbsp toasted walnuts 

Dressing: Caution it’s super yum with bread 🥖 
- [ ] 1 tbsp Olive oil
- [ ] 1.5 tsp Balsamic vinegar 
- [ ] 1 tsp Dijon mustard
- [ ] Drizzle of 🍯, pinch of🧂 & pepper

Method: Preheat oven @400 F. Wrap beets individually in foil #reynoldswrap & then bake for 50 -55 mins(mine 50 mins)! Check if it’s tender time varies based on size of beets. Let it cool down for 10 mins, then peel & diced! Mix spinach, goat cheese, walnuts & add beets! 

Make dressing, add just before eating & enjoy 😉! This dressing is yum with French 🥖 

